import styles from './Card.module.css'

const Card = ({title, description, key}) => {
  return (
    <div className={styles.card_container}>
      <div className={styles.card} key={key}>
        <h4><b>{title}</b></h4>
        <p>"{description}..."</p>
      </div>
    </div>
  )
}

export default Card
